svg.script:
function show_b425ce53(evt, text) {
	var pos = (evt.target.getAttribute("y") < 596) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_b425ce53");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_b425ce53").setAttributeNS(null, "visibility", "visible");
}
function hide_b425ce53(evt) {
	document.getElementById("top_note_b425ce53").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_b425ce53").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_b425ce53").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_b425ce53").setAttributeNS(null, "visibility", "hidden");
}
